import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Bar } from 'react-chartjs-2';
import { ChartData, ChartOptions } from 'chart.js';
import { Chart, registerables } from 'chart.js'; // Import registerables
import { Select, MenuItem, FormControl, InputLabel, CircularProgress, Container, Typography, Table, TableHead, TableRow, TableCell, TableBody } from '@mui/material'; // Import Material-UI components for modern design

interface TeamData {
  teamNumber: string;
  avgAutoCloseNotes: number;
  avgAutoFarNotes: number;
  avgSpeakerNotes: number;
  avgAmpNotes: number;
  avgNotesFed: number;
  avgDefenseRating: number;
}

const DashboardScreen: React.FC = () => {
  const [teamData, setTeamData] = useState<TeamData[]>([]);
  const [selectedMetric, setSelectedMetric] = useState<string>('avgAutoCloseNotes');
  const [loading, setLoading] = useState<boolean>(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:8080/impi/getAvgData/2024mimus');
        const formattedData = Object.entries(response.data).map(([teamNumber, values]) => {
          return {
            teamNumber,
            avgAutoCloseNotes: values[0],
            avgAutoFarNotes: values[1],
            avgSpeakerNotes: values[2],
            avgAmpNotes: values[3],
            avgNotesFed: values[4],
            avgDefenseRating: values[5],
          };
        });

        setTeamData(formattedData as TeamData[]);
      } catch (error) {
        console.error('Error fetching team data:', error);
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  Chart.register(...registerables); // Register all default scales

  const handleMetricChange = (event: React.ChangeEvent<{ value: unknown }>) => {
    setSelectedMetric(event.target.value as string);
  };

  const chartData: ChartData<'bar'> = {
    labels: loading ? [] : teamData.map(team => `Team ${team.teamNumber}`),
    datasets: [
      {
        label: selectedMetric,
        data: loading ? [] : teamData.map(team => team[selectedMetric as keyof TeamData]),
        backgroundColor: 'rgba(75, 192, 192, 0.6)',
        borderColor: 'rgba(75, 192, 192, 1)',
        borderWidth: 1,
      },
    ],
  };

  const chartOptions: ChartOptions<'bar'> = {
    responsive: true,
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  return (
    <Container>
      <Typography variant="h3" component="h1" gutterBottom>
        Team Performance Dashboard
      </Typography>

      <FormControl fullWidth variant="outlined" margin="normal">
        <InputLabel>Select Metric</InputLabel>
        <Select value={selectedMetric} onChange={handleMetricChange} label="Select Metric">
          <MenuItem value="avgAutoCloseNotes">Avg Auto Close Notes</MenuItem>
          <MenuItem value="avgAutoFarNotes">Avg Auto Far Notes</MenuItem>
          <MenuItem value="avgSpeakerNotes">Avg Speaker Notes</MenuItem>
          <MenuItem value="avgAmpNotes">Avg Amp Notes</MenuItem>
          <MenuItem value="avgNotesFed">Avg Notes Fed</MenuItem>
          <MenuItem value="avgDefenseRating">Avg Defense Rating</MenuItem>
        </Select>
      </FormControl>

      {loading ? (
        <CircularProgress />
      ) : (
        <>
          <Bar data={chartData} options={chartOptions} />

          <Typography variant="h4" component="h2" gutterBottom>
            Team Rankings ({selectedMetric.replace('avg', '').replace(/([A-Z])/g, ' $1').trim()})
          </Typography>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Team Number</TableCell>
                <TableCell>{selectedMetric.replace('avg', '').replace(/([A-Z])/g, ' $1').trim()}</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {teamData
                .sort((a, b) => b[selectedMetric as keyof TeamData] - a[selectedMetric as keyof TeamData])
                .map((team) => (
                  <TableRow key={team.teamNumber}>
                    <TableCell>{team.teamNumber}</TableCell>
                    <TableCell>{team[selectedMetric as keyof TeamData]}</TableCell>
                  </TableRow>
                ))}
            </TableBody>
          </Table>
        </>
      )}
    </Container>
  );
};

export default DashboardScreen;
